import React from 'react';

function Test2(props){
  return <h1>hihi {props.food} </h1>
}

const foodIlike = ['stake', 'ramen', 'KFC']


function renderTest(props){
    return <Test2 name={props} />
}


function App() {
  return (
    <div>HELLO!!
    {foodIlike.map(renderTest)}


    </div>
  );
}

export default App;
